import React, { Component } from "react";
import { Link} from "react-router-dom";
import { userService } from "../dataHelper";

export class ListOfPeople extends React.Component {
    constructor(props) {
        super(props);
        this.state = { 
            people: [],
            seq: props?.people?.seq,
            firstname: props?.people?.firstname,
            lastname: props?.people?.lastname,
            age: props?.people?.age,
            street: props?.people?.street,
            city: props?.people?.city,
            state: props?.people?.state,
            latitude: props?.people?.latitude,
            logitude: props?.people?.longitude,
            ccnumber: props?.people?.ccnumber,
            loading: true
        };

    }

    componentDidMount() {
        this.getPeople();
        console.log(this.state);
    }

    async getPeople(){
        const fetchPeople = await userService.fetchData('peopleSearch?/');
        console.log(fetchPeople)
        this.setState({people: fetchPeople, loading:false});
    }

    render() {
        return(
            <div>
            <br/><Link to="/"><button className={"btn btn-link"}>Tilbake til s√∏kesiden</button></Link>
            </div>
        )
    }

}
